import React, { useState } from "react";
import Nav from "react-bootstrap/Nav";
import styles from "./navBar.module.scss";

const navItems = [
  {
    id: 1,
    img: "/static/images/nav/nav1.svg",
  },
  {
    id: 2,
    img: "/static/images/nav/nav1.svg",
