  {
    id: 1,
    img: "/static/images/nav/nav1.svg",
  },
];

const NavBar = () => {
  const [activeItem, setActiveItem] = useState(2);
  const clickItem = (id: number) => {
    setActiveItem(id);
  };
  return (
    <Nav defaultActiveKey="/home" className={`flex-column ${styles.Nav}`}>
      <Nav.Link href="/" className={styles.Logo}>
        <img src="/static/images/logo.svg" alt="logo" />
      </Nav.Link>
      <Nav.Link eventKey="link-1" className={styles.NavItem}>
        <img src="/static/images/nav/nav1.svg" alt="icon" />
      </Nav.Link>
      <Nav.Link eventKey="link-2" className={styles.NavItem}>
        <img src="/static/images/nav/nav2.svg" alt="icon" />
      </Nav.Link>
      <Nav.Link eventKey="disabled" className={styles.NavItem}>
        <img src="/static/images/nav/nav3.svg" alt="icon" />
      </Nav.Link>
      <Nav.Link eventKey="disabled" className={styles.NavItem}>
        <img src="/static/images/nav/nav4.svg" alt="icon" />
      </Nav.Link>
      <Nav.Link eventKey="disabled" className={styles.NavItem}>
        <img src="/static/images/nav/nav5.svg" alt="icon" />
      </Nav.Link>
      <Nav.Link eventKey="disabled" className={styles.NavItem}>
        <img src="/static/images/nav/nav6.svg" alt="icon" />
      </Nav.Link>
      <Nav.Link eventKey="disabled" className={styles.NavItem}>
        <img src="/static/images/nav/nav7.svg" alt="icon" />
      </Nav.Link>
    </Nav>
  );
};

export default NavBar;
